import React from 'react';
import {Link} from 'react-router-dom';
import {useForm} from "react-hook-form";
import axios from "axios";


function RegisterTestPage() {


    const {register, handleSubmit} = useForm();

    function onFormSubmit(data) {
        console.log(data);
        const emailadress = data.email;
        console.log(emailadress);
        const password = data.password;
        console.log(password)
        const role = data.role;
        console.log(role);

        async function makeRegisterRequest() {
            try {
                const response = await axios.post('https://frontend-educational-backend.herokuapp.com/api/auth/signup',
                    {
                        "email": emailadress,
                        "password": password,
                        "role": [role]
                    });
                console.log(response);
            }




    catch
        (e)
        {
            console.error(e)
        }
    }

        makeRegisterRequest()
    }




    return (
        <>
            <h1>Inloggen</h1>
            <form onSubmit={handleSubmit(onFormSubmit)}>
                <label htmlFor="email">E-mail
                    <input
                        type="email"
                        id="email"
                        {...register("email")}/>
                </label>

                <label htmlFor="email">Wachtwoord
                    <input
                        type="password"
                        id="password"
                        {...register("password")}/>
                </label>

                <label htmlFor="role1">Rol in het bedrijf? </label>
                <br/>
                <label htmlFor="role">Studio
                    <input
                        type="radio"
                        id="role1"
                        value="user"
                        {...register("role")}/>
                </label>

                <label htmlFor="role2">Creative
                    <input
                        type="radio"
                        id="role2"
                        value="user"
                        {...register("role")}/>
                </label>

                <label htmlFor="role3">Eventmanager
                    <input
                        type="radio"
                        id="role3"
                        value="admin"
                        {...register("role")}/>
                </label>

                <button
                    type="submit"
                    onClick={onFormSubmit}>
                    Inloggen
                </button>
            </form>

            <p>Heb je al een account? Je kunt je <Link to="/inlog">hier</Link> inloggen.</p>
        </>
    );
}

export default RegisterTestPage;
